					if(d.total){
						return myColor(d.population);
					}else{
						return myColor(1);
					}
				})
				.attr("stroke-width", 1)
				.attr("fill-opacity", .7)
				.on("mouseover", function(d){
					tooltip.style("display", "inline").style("opacity", 1);
					
				})
				.on("mousemove", function(d){
					var TotalClaims=d3.sum(mapData,function(d){return d.population;});
					var percentage=d3.format('.0f')(d.population*100/TotalClaims);
					
					tooltip.html("<strong>State : </strong>"+d.State+'</br>'+
								"<strong>Location : </strong>"+d.Clinic_Location+'</br>'+
								"<strong>Clinic Type : </strong>"+d.Type+'</br>'+
					"<strong>No of Patients : </strong>"+d3.format(',')(d.population)+' ('+percentage+'%) ')
							.style("top", (event.pageY-10)+"px")
							.style("left",(event.pageX+10)+"px");
				})
				.on("mouseout", function(){
					tooltip.style("display", "none").style("opacity", 0);
				});
				
		d3.select('.download_opt').on('click',function(){console.log('hi');});
		function updatecircles() {
		  d3.selectAll(".location_circles")
			.attr("cx", function(d){ return map.latLngToLayerPoint([d.Lat, d.Long]).x })
			.attr("cy", function(d){ return map.latLngToLayerPoint([d.Lat, d.Long]).y })
		}
		map.on("moveend", updatecircles)
	}
	
		</script>

	function format(x) {
			var negative = x < 0,
					str = String(negative ? -x : x),
					arr = [],
					i = str.indexOf("."),
					j;
			if (i === -1) {
				i = str.length;
			} else {
				for (j = str.length - 1; j > i; j--) {
					arr.push(str[j]);
				}
				arr.push(".");
			}
			i--;
			for (j = 0; i >= 0; i--, j++) {
				if (j > 2 && (j % 2 === 1)) {
					arr.push(",");
				}
				arr.push(str[i]);
			}
			if (negative) {
				arr.push("-");
			}
			return arr.reverse().join("");
		}

	function format(x) {
			var negative = x < 0,
					str = String(negative ? -x : x),
					arr = [],
					i = str.indexOf("."),
					j;
			if (i === -1) {
				i = str.length;
			} else {
				for (j = str.length - 1; j > i; j--) {
					arr.push(str[j]);
				}
				arr.push(".");
			}
			i--;
			for (j = 0; i >= 0; i--, j++) {
				if (j > 2 && (j % 2 === 1)) {
					arr.push(",");
				}
				arr.push(str[i]);
			}
			if (negative) {
				arr.push("-");
			}
			return arr.reverse().join("");
		}

				  aspect = width / height;

				  .attr("preserveAspectRatio", "xMinYMid")
				  .call(resize);
			  d3.select(window).on("resize." + container.attr("id"), resize);
			  function resize() {
				  var targetWidth = parseInt(container.style("width"));
				  svg.attr("width", targetWidth);
				  svg.attr("height", Math.round(targetWidth / aspect));
